import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  return (
    <HeaderContainer>
      <Nav>
         <Logo to="/">.</Logo> 
        <NavLinks>
          <NavLink to="/noticeboard">게시판</NavLink>
          <NavLink to="/about">BKO</NavLink>
          <NavLink to="/services">MLB</NavLink>
          <NavLink to="/contact">게임</NavLink>
        </NavLinks>
        <NavLink to="/contact">로그인</NavLink>
      </Nav>
    </HeaderContainer>
  );
};

export default Header;
